			function ArticleDateFormat(d) {
				var _thu = Array('Ch&#7911; nh&#7853;t','Th&#7913; 2','Th&#7913; 3','Th&#7913; 4','Th&#7913; 5','Th&#7913; 6','Th&#7913; 7');
				
				if(d!='') {
					var d1=new Date(d);
				} else {
					var d1=new Date();
				}
				var _day = d1.getDay();
				var _date = d1.getDate();
				if(_date.toString().length<2) _date='0'+_date;
				var _month = d1.getMonth() + 1;
				if(_month.toString().length<2) _month='0'+_month;
				var _year = d1.getFullYear();
				//var _year = (d1.getYear() < 1000) ? d1.getYear() + 1900 : d1.getYear();
				var _hour = d1.getHours();
				var _minutes = d1.getMinutes();
				
				var res = _thu[_day] + ", " + _date + "/" + _month + "/" + _year + ", " + _hour + ":" + _minutes + " GMT+7";
				
				return res;
			} // End ArticleDateFormat
